//pages/Nav.js
import React from "react";
import './headerMain.css';
function headerMain() {
  return (

    <div>
        <div className = "HeadLine">
            <div id = "Logo">#강원여행</div>
            <div id = "weatherCast">여행 예보</div>
            <div id = "search"></div>
            <div id = "logIn">LOGIN</div>
            <div id = "myPage"></div>
        </div>
            <div className = "MenuBar">

            </div>
    </div>
    
  );
}

export default headerMain;
